import axios from 'axios';
import * as React from 'react';

export function decryptPassword(encryption){
    axios.post('http://localhost:5000/decryptpassword', { 
        password: encryption.password,
        iv: encryption.iv 
    }).then((response) => {
        return response.data
    })}
